First, create a `TooltipContext` to store the state of the currently opened Tooltip and a function to close it.

```jsx
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const closeTooltip = () => {
    setTooltip(null);
  };

  const value = { tooltip, closeTooltip };

  return (
    <TooltipContext.Provider value={value}>{children}</TooltipContext.Provider>
  );
};
```

Next, create the Tooltip component that uses the `TooltipContext` to open and close the tooltip.

```jsx
import React, { useContext, useState } from 'react';
import { TooltipContext } from './TooltipContext';

const Tooltip = ({ children, placement = 'bottom', content }) => {
  const { tooltip, closeTooltip } = useContext(TooltipContext);
  const [isOpen, setIsOpen] = useState(false);

  const handleMouseEnter = () => {
    if (!tooltip) {
      setIsOpen(true);
    }
  };

  const handleMouseLeave = () => {
    if (tooltip !== content) {
      setIsOpen(false);
    }
    closeTooltip();
  };

  return (
    <>
      {React.cloneElement(children, {
        onMouseEnter: handleMouseEnter,
        onMouseLeave: handleMouseLeave,
      })}
      {isOpen && (
        <div
          className={`tooltip ${placement}`}
          style={{ top: `${children.getBoundingClientRect().bottom + 10}px`, left: `${children.getBoundingClientRect().left}px` }}
        >
          {content}
        </div>
      )}
    </>
  );
};

export default Tooltip;
```

Finally, use the Tooltip component in your NextJS application.

```jsx
import Tooltip from '../components/Tooltip';

const MyComponent = () => {
  return (
    <TooltipProvider>
      <Tooltip placement="top" content="This is a tooltip">
        <div>Hover over me</div>
      </Tooltip>
      {/* More components here */}
    </TooltipProvider>
  );
};

export default MyComponent;
```

Now, when you hover over the `<div>Hover over me</div>`, the tooltip will open, and when you hover over another tooltip, the previously opened tooltip will close.

